INSERT INTO `book` VALUES ('10',2,'Tăng trưởng thông minh',300000,'2023',256,44,3.7,'Cách tăng trưởng thông minh','http://localhost:8080/image?id=76760019-d6e1-43ce-9ee4-14f6b7648dbf',NULL),('11',4,'Ảo dạ 1',180000,'2023',879,85,3.5,'Truyện ảo vcl','http://localhost:8080/image?id=bd95a2ac-692e-4d22-92f5-5aaef74af440',NULL),('12',2,'Lá thư cuối 1',145000,'2022',998,43,4.8,'Đâu ai biết lần gặp lúc đó là lần cuối cùng','http://localhost:8080/image?id=3882824b-49c6-4b01-8a98-126618a43e11',NULL),('13',1,'Bạch dạ hành',89000,'2021',378,25,4.3,'Bạch dạ bị hành ra bã','http://localhost:8080/image?id=aa9d483f-233d-4283-84f8-9a3b32d4a0ee',NULL),('14',5,'Lược sử khoa học 2',289000,'2020',929,666,5,'Quá trình phát triển khoa học thế giới','http://localhost:8080/image?id=ff6e56ed-0b7b-4d53-a804-07e92aa9c874',NULL),('15',3,'Những ngộ nhận về marketing',210000,'2016',15,89,3.2,'Làm thế nào bán được 1 tỉ gói mè','http://localhost:8080/image?id=9c3c83f2-92ea-469e-a743-d32d64e77a67',NULL),('2',2,'3 phút sơ cứu',120000,'2021',500,3000,4.5,'3 phut cuu song nguoi khac','http://localhost:8080/image?id=caf148ec-7a06-45f1-8296-98cc760123ff',NULL),('3',6,'Khoa học về chạy bộ',90000,'2018',2018,20,4,'tim hieu ve chay bo','http://localhost:8080/image?id=2161d951-dedf-4eff-ae9b-aa5bd3dccf77',NULL),('4',4,'Dưỡng da tối giản',100000,'2017',474,30,4.2,'Tìm hiểu về quy trình skincare của sao hàn','http://localhost:8080/image?id=ab1a007f-2ac8-41ec-afd6-3709ef164ce4',NULL),('5',2,'Marketing kiểu Xiaomi',210000,'2022',1089,899,4.3,'Cuốn sách này là câu chuyện về sự hình thành và thành công của chiến lược marketing được xem là nền tảng cho cú bùng nổ ngoạn mục của Xiaomi: trở thành nhà sản xuất điện thoại thông minh đứng thứ ba thế giới, ngay sau Apple và Samsung. Năm 2014, Xiaomi trở thành một hiện tượng công nghệ, được coi như “Apple của Trung Quốc” khi tung ra sản phẩm Mi3, chính thức đưa Xiaomi lên bản đồ kinh doanh thế giới, trở thành một trong những “start-up công nghệ có giá trị nhất trên thế giới” với giá khoảng 46 tỷ đô la. Trở thành nhà sản xuất điện thoại thông minh lớn thứ ba thế giới, đứng ngay sau hai gã khổng lồ Apple và Samsung, Xiaomi còn làm một cuộc cách mạng trong ngành công nghiệp này bằng chiến lược Bán sản phẩm cao cấp với giá bình dân. Nhưng đến năm 2016, doanh thu của hãng giảm mạnh, nguyên nhân chủ yếu được cho là quá phụ thuộc vào kinh doanh trực tuyến, bỏ bê những khách hàng ít hiểu biết về công nghệ. Một năm sau, với chiến lược marketing hoàn toàn khác biệt, không quảng cáo rầm rộ, không thuê người nổi tiếng khuếch trương thương hiệu mà tập trung hoàn toàn vào các fan trung thành với các chương trình cụ thể như: quy tắc chung sức 3-3, các buổi gặp gỡ fan định kỳ, thường niên…','http://localhost:8080/api/image?id=a5b60101-2a41-4c6f-8b2f-06a709cb9515',NULL),('6',3,'Lincoln bàn về lãnh đạo',270000,'2019',200,90,4.1,'Lincoln bàn về vấn đề lãnh đạo','http://localhost:8080/image?id=f93c6c75-f158-4751-92b2-77fba4bc0869',NULL),('7',3,'Hannibal',250000,'2020',1000,100,4.7,'Câu chuyện về gã ăn thịt người','http://localhost:8080/image?id=210e01dc-f7da-489c-9526-c6adde962537',NULL),('8',4,'Luật của kẻ thắng',120000,'2000',565,80,4.3,'Khi thắng bạn nói cái lồn gì cũng đúng','http://localhost:8080/image?id=5df59a1a-6cbd-4b00-8908-db43ef9b65a4',NULL),('9',1,'Pippi tất dài',100000,'2001',150,50,4.4,'Cuộc sống thường ngày và các cuộc phiêu lưu của Pippi tất dài','http://localhost:8080/image?id=799854b7-9971-4000-b871-778738892171',NULL);
